import React from 'react'
import '../index.css'

const SearchBox = ({ searchChange, searchField }) => {
    return (
        <div>
            <input className="search-box center" type="search" placeholder="Search Robots" onChange={searchChange}/>
        </div>
    )
}

export default SearchBox;
